  true,\n\t\"url\": null,\n\t\"notes\": \"The NASA IceBridge Sigma Space Prototype
  L0 Raw Time-of-Flight Data set (ILSSP0) contains time-of-flight data captured over
  Antarctica using the Sigma Space Photon Counting Lidar Prototype instrument.  The
  data were collected by scientists working on the Investigating the Cryospheric Evolution
  of the Central Antarctic Plate (ICECAP) project, which is funded by the National
  Science Foundation (NSF) and the Natural Environment Research Council (NERC) with
  additional support from NASA Operation IceBridge. The data are stored in binary
  format and are available for periodic, ongoing campaigns from 2009 to the present
  via FTP.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
